INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ヒヨリ", 100101, "2030/12/31 15:00:00", 1, 1, 2.295, 1, 100101, "【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", 0, 7, 100101, "ひより", 100101, 0, 0, 1, 0, 0, "2015/04/01 15:00:00", 0, 0, 200);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユイ", 100201, "2030/12/31 15:00:00", 2, 7, 2.27, 1, 100201, "【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", 0, 7, 100201, "ゆい", 100201, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 800);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "レイ", 100301, "2030/12/31 15:00:00", 1, 4, 1.965, 1, 100301, "【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", 0, 7, 100301, "れい", 100301, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 250);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミソギ", 100401, "2030/12/31 15:00:00", 1, 1, 2.17, 1, 100401, "【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", 0, 13, 100401, "みそぎ", 100401, 0, 0, 1, 0, 0, "2015/04/01 15:00:00", 0, 0, 205);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マツリ", 100501, "2030/12/31 15:00:00", 1, 2, 2.125, 2, 100501, "【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", 0, 2, 100501, "まつり", 100501, 0, 0, 2, 0, 0, "2018/09/18 15:00:00", 0, 0, 185);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アカリ", 100601, "2030/12/31 15:00:00", 2, 6, 2.19, 2, 100601, "【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", 0, 14, 100601, "あかり", 100601, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 570);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミヤコ", 100701, "2030/12/31 15:00:00", 1, 3, 1.7, 2, 100701, "【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", 0, 14, 100701, "みやこ", 100701, 0, 0, 3, 0, 0, "2015/04/01 15:00:00", 0, 0, 125);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユキ", 100801, "2030/12/31 15:00:00", 2, 21, 2.07, 2, 100801, "【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", 0, 12, 100801, "ゆき", 100801, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 805);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アンナ", 100901, "2030/12/31 15:00:00", 2, 5, 2.25, 3, 100901, "【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", 0, 11, 100901, "あんな", 100901, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 440);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マホ", 101001, "2030/12/31 15:00:00", 2, 7, 2.27, 3, 101001, "【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", 0, 4, 101001, "まほ", 101001, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 795);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リノ", 101101, "2030/12/31 15:00:00", 1, 8, 1.97, 3, 101101, "【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", 0, 6, 101101, "りの", 101101, 0, 0, 8, 0, 0, "2015/04/01 15:00:00", 0, 0, 700);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ハツネ", 101201, "2030/12/31 15:00:00", 2, 7, 2.07, 3, 101201, "【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", 0, 9, 101201, "はつね", 101201, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 755);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ナナカ", 101301, "2030/12/31 15:00:00", 2, 7, 2.07, 2, 101301, "【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", 0, 9, 101301, "ななか", 101301, 0, 0, 7, 0, 0, "2018/11/19 15:00:00", 0, 0, 740);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カスミ", 101401, "2030/12/31 15:00:00", 2, 21, 2.27, 3, 101401, "【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", 0, 9, 101401, "かすみ", 101401, 0, 0, 7, 0, 0, "2019/02/28 12:00:00", 0, 0, 730);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミサト", 101501, "2030/12/31 15:00:00", 2, 9, 2.27, 2, 101501, "【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。", 0, 9, 101501, "みさと", 101501, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 735);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズナ", 101601, "2030/12/31 15:00:00", 1, 8, 1.97, 2, 101601, "【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", 0, 15, 101601, "すずな", 101601, 0, 0, 8, 0, 0, "2015/04/01 15:00:00", 0, 0, 705);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カオリ", 101701, "2030/12/31 15:00:00", 1, 1, 2.17, 2, 101701, "【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。", 0, 4, 101701, "かおり", 101701, 0, 0, 1, 0, 0, "2015/04/01 15:00:00", 0, 0, 145);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イオ", 101801, "2030/12/31 15:00:00", 2, 5, 2.6, 3, 101801, "【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。", 0, 15, 101801, "いお", 101801, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 715);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミミ", 102001, "2030/12/31 15:00:00", 1, 5, 2.125, 2, 102001, "【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", 0, 13, 102001, "みみ", 102001, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 360);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クルミ", 102101, "2030/12/31 15:00:00", 1, 3, 1.675, 1, 102101, "【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", 0, 3, 102101, "くるみ", 102101, 0, 0, 3, 0, 0, "2015/04/01 15:00:00", 0, 0, 240);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ヨリ", 102201, "2030/12/31 15:00:00", 2, 6, 2.19, 1, 102201, "【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", 0, 14, 102201, "より", 102201, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 575);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アヤネ", 102301, "2030/12/31 15:00:00", 1, 3, 1.425, 2, 102301, "【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", 0, 3, 102301, "あやね", 102301, 0, 0, 3, 0, 0, "2015/04/01 15:00:00", 0, 0, 210);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズメ", 102501, "2030/12/31 15:00:00", 2, 7, 2.27, 1, 102501, "【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", 0, 3, 102501, "すずめ", 102501, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 720);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リン", 102601, "2030/12/31 15:00:00", 1, 6, 2.34, 2, 102601, "【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", 0, 3, 102601, "りん", 102601, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 550);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "エリコ", 102701, "2030/12/31 15:00:00", 1, 3, 1.425, 2, 102701, "【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで敵に\nとどめの一撃を放つ毎に、その攻撃力はさらに上昇する。", 0, 11, 102701, "えりこ", 102701, 0, 0, 3, 0, 0, "2015/04/01 15:00:00", 0, 0, 230);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "サレン", 102801, "2030/12/31 15:00:00", 1, 4, 2.09, 3, 102801, "【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", 0, 3, 102801, "されん", 102801, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 430);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ノゾミ", 102901, "2030/12/31 15:00:00", 1, 4, 1.965, 3, 102901, "【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", 0, 10, 102901, "のぞみ", 102901, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 160);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ニノン", 103001, "2030/12/31 15:00:00", 1, 5, 2.25, 3, 103001, "【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", 0, 12, 103001, "にのん", 103001, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 415);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シノブ", 103101, "2030/12/31 15:00:00", 1, 5, 2.25, 2, 103101, "【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", 0, 14, 103101, "しのぶ", 103101, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 365);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アキノ", 103201, "2030/12/31 15:00:00", 1, 5, 2.125, 3, 103201, "【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", 0, 8, 103201, "あきの", 103201, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 180);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マヒル", 103301, "2030/12/31 15:00:00", 1, 6, 2.34, 2, 103301, "【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", 0, 5, 103301, "まひる", 103301, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 395);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユカリ", 103401, "2030/12/31 15:00:00", 1, 5, 2.4, 1, 103401, "【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", 0, 8, 103401, "ゆかり", 103401, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 405);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "キョウカ", 103601, "2030/12/31 15:00:00", 2, 7, 2.07, 3, 103601, "【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", 0, 0, 103601, "きょうか", 103601, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 810);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "トモ", 103701, "2030/12/31 15:00:00", 1, 4, 1.965, 3, 103701, "【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", 0, 2, 103701, "とも", 103701, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 220);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シオリ", 103801, "2030/12/31 15:00:00", 1, 8, 1.97, 2, 103801, "【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", 0, 5, 103801, "しおり", 103801, 0, 0, 8, 0, 0, "2015/04/01 15:00:00", 0, 0, 710);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アオイ", 104001, "2030/12/31 15:00:00", 1, 8, 1.97, 1, 104001, "【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", 0, 9, 104001, "あおい", 104001, 0, 0, 8, 0, 0, "2015/04/01 15:00:00", 0, 0, 785);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "チカ", 104201, "2030/12/31 15:00:00", 2, 7, 2.27, 2, 104201, "【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", 0, 10, 104201, "ちか", 104201, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 790);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マコト", 104301, "2030/12/31 15:00:00", 1, 5, 2.125, 3, 104301, "【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", 0, 4, 104301, "まこと", 104301, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 165);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イリヤ", 104401, "2030/12/31 15:00:00", 2, 3, 1.425, 3, 104401, "【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", 0, 12, 104401, "いりや", 104401, 0, 0, 3, 0, 0, "2015/04/01 15:00:00", 0, 0, 425);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クウカ", 104501, "2030/12/31 15:00:00", 1, 2, 2.375, 2, 104501, "【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", 0, 12, 104501, "くうか", 104501, 0, 0, 2, 0, 0, "2015/04/01 15:00:00", 0, 0, 130);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "タマキ", 104601, "2030/12/31 15:00:00", 1, 2, 2.25, 2, 104601, "【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", 0, 8, 104601, "たまき", 104601, 0, 0, 2, 0, 0, "2015/04/01 15:00:00", 0, 0, 215);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ジュン", 104701, "2030/12/31 15:00:00", 1, 5, 2.125, 3, 104701, "【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", 0, 2, 104701, "じゅん", 104701, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 135);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミフユ", 104801, "2030/12/31 15:00:00", 1, 6, 2.19, 2, 104801, "【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", 0, 8, 104801, "みふゆ", 104801, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 420);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シズル", 104901, "2030/12/31 15:00:00", 1, 5, 2.375, 3, 104901, "【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", 0, 6, 104901, "しずる", 104901, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 285);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミサキ", 105001, "2030/12/31 15:00:00", 2, 7, 2.07, 1, 105001, "【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", 0, 15, 105001, "みさき", 105001, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 760);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミツキ", 105101, "2030/12/31 15:00:00", 1, 5, 2.25, 2, 105101, "【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", 0, 11, 105101, "みつき", 105101, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 565);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リマ", 105201, "2030/12/31 15:00:00", 1, 4, 2.215, 1, 105201, "【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", 0, 5, 105201, "りま", 105201, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 105);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "モニカ", 105301, "2030/12/31 15:00:00", 1, 4, 2.24, 3, 105301, "【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", 0, 12, 105301, "もにか", 105301, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 410);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ツムギ", 105401, "2030/12/31 15:00:00", 1, 1, 2.42, 2, 105401, "【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", 0, 10, 105401, "つむぎ", 105401, 0, 0, 1, 0, 0, "2015/04/01 15:00:00", 0, 0, 195);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アユミ", 105501, "2030/12/31 15:00:00", 1, 48, 2.34, 1, 105501, "【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", 0, 12, 105501, "あゆみ", 105501, 0, 0, 48, 0, 0, "2019/03/19 15:00:00", 0, 0, 510);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ルカ", 105601, "2030/12/31 15:00:00", 1, 4, 1.965, 3, 105601, "【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", 0, 2, 105601, "るか", 105601, 0, 0, 4, 0, 0, "2018/11/03 19:00:00", 0, 0, 158);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ジータ", 105701, "2030/12/31 15:00:00", 1, 4, 1.965, 3, 105701, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 0, 4, 170101, "じーた", 105701, 0, 0, 4, 0, 0, "2015/04/01 15:00:00", 0, 0, 245);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ペコリーヌ", 105801, "2030/12/31 15:00:00", 1, 5, 2.25, 1, 105801, "【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", 0, 1, 105801, "ぺこりーぬ", 105801, 0, 0, 5, 0, 0, "2015/04/01 15:00:00", 0, 0, 155);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "コッコロ", 105901, "2030/12/31 15:00:00", 1, 6, 2.34, 1, 105901, "【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", 0, 1, 105901, "こっころ", 105901, 0, 0, 6, 0, 0, "2015/04/01 15:00:00", 0, 0, 500);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "キャル", 106001, "2030/12/31 15:00:00", 2, 7, 2.07, 1, 106001, "【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", 0, 1, 106001, "きゃる", 106001, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 750);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ムイミ", 106101, "2025/03/03 18:59:59", 1, 2, 1.8, 3, 106101, "【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", 0, 7, 106101, "むいみ", 106101, 0, 0, 2, 0, 0, "2025/02/28 12:00:00", 0, 1, 162);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アリサ", 106301, "2030/12/31 15:00:00", 1, 8, 1.97, 3, 106301, "【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", 0, 1, 106301, "ありさ", 106301, 0, 0, 8, 0, 0, "2015/04/01 15:00:00", 0, 0, 625);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シェフィ", 106401, "2030/12/31 15:00:00", 1, 4, 1.84, 3, 106401, "【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", 0, 1, 106401, "しぇふぃ", 106401, 0, 0, 4, 0, 0, "2021/02/15 23:00:00", 0, 0, 368);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カヤ", 106501, "2030/12/31 15:00:00", 1, 1, 2.17, 3, 106501, "【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", 0, 17, 106501, "かや", 106501, 0, 0, 1, 0, 0, "2019/11/15 15:00:00", 0, 0, 168);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イノリ", 106601, "2030/12/31 15:00:00", 1, 3, 1.55, 3, 106601, "【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", 0, 17, 106601, "いのり", 106601, 0, 0, 3, 0, 0, "2020/06/17 15:00:00", 0, 0, 197);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ホマレ", 106701, "2025/03/03 18:59:59", 2, 21, 2.27, 3, 106701, "【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。", 0, 17, 106701, "ほまれ", 106701, 0, 0, 7, 0, 0, "2025/02/28 12:00:00", 0, 1, 727);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ラビリスタ", 106801, "2025/03/03 18:59:59", 1, 4, 1.55, 3, 106801, "【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", 0, 6, 106801, "らびりすた", 106801, 0, 0, 4, 0, 0, "2025/02/28 12:00:00", 0, 1, 560);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カイザーインサイト", 106901, "2030/12/31 15:00:00", 1, 0, 2.0, 3, 106901, "【物理】後衛で、天の星を瞳に宿し、覇道を進む皇。\n権能を解放し敵全体のバリアと全ステータスアップ効果を\n解除し、耐久力ダウンと複数の広範囲攻撃で敵を滅する。", 0, 1, 106901, "かいざーいんさいと", 106901, 0, 0, 45, 0, 0, "2022/11/15 15:00:00", 0, 1, 660);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ネネカ", 107001, "2025/03/03 18:59:59", 2, 0, 2.0, 3, 107001, "【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", 0, 1, 107001, "ねねか", 107001, 0, 0, 0, 0, 0, "2025/02/28 12:00:00", 0, 1, 660);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クリスティーナ", 107101, "2025/03/03 18:59:59", 1, 10, 2.0, 3, 107101, "【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", 0, 2, 107101, "くりすてぃーな", 107101, 0, 0, 4, 0, 0, "2025/02/28 12:00:00", 0, 1, 290);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ペコリーヌ（サマー）", 107501, "2024/06/26 11:59:59", 1, 5, 2.125, 3, 107501, "【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", 0, 1, 107501, "ぺこりーぬ", 107501, 0, 0, 5, 0, 0, "2024/06/21 12:00:00", 0, 1, 235);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "コッコロ（サマー）", 107601, "2030/12/31 15:00:00", 1, 6, 2.34, 1, 107601, "【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", 0, 1, 107601, "こっころ", 107601, 0, 0, 6, 0, 0, "2020/06/19 15:00:00", 0, 1, 535);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズメ（サマー）", 107701, "2024/06/26 11:59:59", 2, 7, 2.07, 3, 107701, "【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", 0, 3, 107701, "すずめ", 107701, 0, 0, 7, 0, 0, "2024/06/21 12:00:00", 0, 1, 775);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "キャル（サマー）", 107801, "2024/06/26 11:59:59", 2, 7, 1.92, 3, 107801, "【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", 0, 1, 107801, "きゃる", 107801, 0, 0, 7, 0, 0, "2024/06/21 12:00:00", 0, 1, 780);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "タマキ（サマー）", 107901, "2024/06/26 11:59:59", 1, 2, 2.0, 3, 107901, "【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", 0, 8, 107901, "たまき", 107901, 0, 0, 2, 0, 0, "2024/06/21 12:00:00", 0, 1, 225);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミフユ（サマー）", 108001, "2030/12/31 15:00:00", 1, 6, 2.19, 1, 108001, "【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", 0, 8, 108001, "みふゆ", 108001, 0, 0, 6, 0, 0, "2020/07/20 15:00:00", 0, 1, 495);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シノブ（ハロウィン）", 108101, "2024/10/28 11:59:59", 1, 3, 1.55, 3, 108101, "【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", 0, 0, 108101, "しのぶ", 108101, 0, 0, 3, 0, 0, "2024/10/24 12:00:00", 0, 1, 440);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミヤコ（ハロウィン）", 108201, "2030/12/31 15:00:00", 1, 1, 2.42, 1, 108201, "【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", 0, 0, 108201, "みやこ", 108201, 0, 0, 1, 0, 0, "2020/09/23 15:00:00", 0, 1, 590);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミサキ（ハロウィン）", 108301, "2024/10/28 11:59:59", 2, 7, 2.07, 3, 108301, "【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", 0, 15, 108301, "みさき", 108301, 0, 0, 7, 0, 0, "2024/10/24 12:00:00", 0, 1, 815);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "チカ（クリスマス）", 108401, "2024/12/31 11:59:59", 2, 7, 2.27, 3, 108401, "【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", 0, 10, 108401, "ちか", 108401, 0, 0, 7, 0, 0, "2024/12/22 12:00:00", 0, 1, 770);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クルミ（クリスマス）", 108501, "2030/12/31 15:00:00", 1, 3, 1.55, 1, 108501, "【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", 0, 15, 108501, "くるみ", 108501, 0, 0, 3, 0, 0, "2020/11/24 15:00:00", 0, 1, 295);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アヤネ（クリスマス）", 108601, "2024/12/31 11:59:59", 1, 3, 1.425, 3, 108601, "【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", 0, 10, 108601, "あやね", 108601, 0, 0, 3, 0, 0, "2024/12/22 12:00:00", 0, 1, 190);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ヒヨリ（ニューイヤー）", 108701, "2025/01/20 11:59:59", 1, 1, 2.17, 3, 108701, "【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", 0, 7, 108701, "ひより", 108701, 0, 0, 1, 0, 0, "2025/01/15 15:00:00", 0, 1, 170);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユイ（ニューイヤー）", 108801, "2025/01/20 11:59:59", 2, 21, 2.27, 3, 108801, "【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", 0, 7, 108801, "ゆい", 108801, 0, 0, 7, 0, 0, "2025/01/15 15:00:00", 0, 1, 745);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "レイ（ニューイヤー）", 108901, "2030/12/31 15:00:00", 1, 22, 2.215, 1, 108901, "【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", 0, 7, 108901, "れい", 108901, 0, 0, 4, 0, 0, "2020/12/22 15:00:00", 0, 1, 153);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "エリコ（バレンタイン）", 109001, "2030/12/31 15:00:00", 1, 3, 1.9, 1, 109001, "【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", 0, 11, 109001, "えりこ", 109001, 0, 0, 3, 0, 0, "2021/01/25 15:00:00", 0, 1, 187);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シズル（バレンタイン）", 109101, "2025/02/24 11:59:59", 1, 5, 2.125, 3, 109101, "【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", 0, 7, 109101, "しずる", 109101, 0, 0, 5, 0, 0, "2025/02/20 12:00:00", 0, 1, 385);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アン", 109201, "2030/12/31 15:00:00", 2, 23, 2.27, 3, 109201, "【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。", 0, 6, 109201, "あん", 109201, 0, 0, 7, 0, 0, "2019/03/31 12:00:00", 0, 0, 630);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ルゥ", 109301, "2030/12/31 15:00:00", 2, 23, 2.27, 1, 109301, "【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。", 0, 9, 109301, "るぅ", 109301, 0, 0, 7, 0, 0, "2021/03/23 15:00:00", 0, 1, 640);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "グレア", 109401, "2030/12/31 15:00:00", 2, 1, 2.27, 3, 109401, "【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。", 0, 9, 109401, "ぐれあ", 109401, 0, 0, 1, 0, 0, "2019/04/19 15:00:00", 0, 0, 525);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クウカ（オーエド）", 109501, "2030/12/31 15:00:00", 2, 2, 2.066, 3, 109501, "【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。", 0, 12, 109501, "くうか", 109501, 0, 0, 7, 0, 0, "2019/04/30 12:00:00", 0, 0, 140);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ニノン（オーエド）", 109601, "2030/12/31 15:00:00", 1, 2, 2.0, 3, 109601, "【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。", 0, 12, 109601, "にのん", 109601, 0, 0, 2, 0, 0, "2019/05/17 15:00:00", 0, 0, 175);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "レム", 109701, "2024/09/25 11:59:59", 1, 24, 2.25, 3, 109701, "【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。", 0, 9, 109701, "れむ", 109701, 0, 0, 13, 0, 0, "2024/09/15 15:00:00", 0, 1, 540);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ラム", 109801, "2030/12/31 15:00:00", 2, 24, 2.5, 1, 109801, "【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。", 0, 9, 109801, "らむ", 109801, 0, 1, 7, 0, 0, "2015/04/01 15:00:00", 0, 1, 545);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "エミリア", 109901, "2024/09/25 11:59:59", 2, 23, 2.27, 3, 109901, "【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。", 0, 9, 109901, "えみりあ", 109901, 0, 0, 7, 0, 0, "2024/09/15 15:00:00", 0, 1, 725);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズナ（サマー）", 110001, "2024/06/26 11:59:59", 1, 8, 1.82, 3, 110001, "【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に放つ「サマーランウェイ♪」でＴＰを全回復\nして、発動後のユニオンバーストがクリティカルになる。", 0, 15, 110001, "すずな", 110001, 0, 0, 8, 0, 0, "2024/06/21 12:00:00", 0, 1, 705);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イオ（サマー）", 110101, "2030/12/31 15:00:00", 2, 5, 2.4, 1, 110101, "【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。", 0, 15, 110101, "いお", 110101, 0, 0, 5, 0, 0, "2021/05/18 15:00:00", 0, 1, 715);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "ミサキ（サマー）", 110201, "2030/12/31 15:00:00", 0, 7, 0.0, 1, 110201, "", 0, 15, 0, "みさき", 0, 0, 0, 7, 0, 0, "2015/04/01 15:00:00", 0, 0, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "サレン（サマー）", 110301, "2024/06/26 11:59:59", 1, 4, 2.24, 3, 110301, "【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", 0, 3, 110301, "されん", 110301, 0, 0, 4, 0, 0, "2024/06/21 12:00:00", 0, 1, 585);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マコト（サマー）", 110401, "2024/07/31 11:59:59", 1, 5, 2.125, 3, 110401, "【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", 0, 4, 110401, "まこと", 110401, 0, 0, 5, 0, 0, "2024/07/23 12:00:00", 0, 1, 180);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カオリ（サマー）", 110501, "2030/12/31 15:00:00", 1, 1, 2.42, 1, 110501, "【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", 0, 4, 110501, "かおり", 110501, 0, 0, 1, 0, 0, "2021/06/18 15:00:00", 0, 1, 425);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マホ（サマー）", 110601, "2024/07/31 11:59:59", 2, 7, 2.27, 3, 110601, "【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", 0, 4, 110601, "まほ", 110601, 0, 0, 7, 0, 0, "2024/07/23 12:00:00", 0, 1, 792);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アオイ（編入生）", 110701, "2030/12/31 15:00:00", 1, 8, 1.82, 3, 110701, "【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", 0, 4, 110701, "あおい", 110701, 0, 0, 8, 0, 0, "2019/09/03 21:00:00", 0, 0, 680);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クロエ", 110801, "2030/12/31 15:00:00", 1, 2, 2.125, 3, 110801, "【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", 0, 2, 110801, "くろえ", 110801, 0, 0, 2, 0, 0, "2019/09/16 15:00:00", 0, 0, 185);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "チエル", 110901, "2030/12/31 15:00:00", 1, 1, 2.295, 3, 110901, "【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", 0, 2, 110901, "ちえる", 110901, 0, 0, 1, 0, 0, "2020/04/15 15:00:00", 0, 0, 222);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユニ", 111001, "2030/12/31 15:00:00", 2, 26, 2.27, 3, 111001, "【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", 0, 2, 111001, "ゆに", 111001, 0, 0, 7, 0, 0, "2020/03/31 12:00:00", 0, 0, 807);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "キョウカ（ハロウィン）", 111101, "2024/10/28 11:59:59", 2, 7, 2.07, 3, 111101, "【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", 0, 13, 111101, "きょうか", 111101, 0, 0, 7, 0, 0, "2024/10/24 12:00:00", 0, 1, 820);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミソギ（ハロウィン）", 111201, "2030/12/31 15:00:00", 1, 1, 2.17, 1, 111201, "【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", 0, 13, 111201, "みそぎ", 111201, 0, 0, 1, 0, 0, "2021/08/16 15:00:00", 0, 1, 212);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミミ（ハロウィン）", 111301, "2030/12/31 15:00:00", 1, 5, 2.0, 3, 111301, "【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", 0, 13, 111301, "みみ", 111301, 0, 0, 5, 0, 0, "2019/10/16 15:00:00", 0, 0, 365);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ルナ", 111401, "2030/12/31 15:00:00", 2, 25, 1.87, 3, 111401, "【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", 0, 0, 111401, "るな", 111401, 0, 0, 7, 0, 0, "2019/10/31 12:00:00", 0, 0, 765);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クリスティーナ（クリスマス）", 111501, "2024/12/31 11:59:59", 1, 10, 2.0, 3, 111501, "【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", 0, 13, 111501, "くりすてぃーな", 111501, 0, 0, 4, 0, 0, "2024/12/22 12:00:00", 0, 1, 265);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ノゾミ（クリスマス）", 111601, "2030/12/31 15:00:00", 1, 4, 2.24, 1, 111601, "【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", 0, 13, 111601, "のぞみ", 111601, 0, 0, 4, 0, 0, "2021/10/19 15:00:00", 0, 1, 418);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イリヤ（クリスマス）", 111701, "2030/12/31 15:00:00", 2, 3, 1.3, 3, 111701, "【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", 0, 13, 111701, "いりや", 111701, 0, 0, 3, 0, 0, "2019/12/20 15:00:00", 0, 0, 255);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ペコリーヌ（ニューイヤー）", 111801, "2025/01/20 11:59:59", 1, 22, 1.965, 3, 111801, "【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", 0, 13, 111801, "ぺこりーぬ", 111801, 0, 0, 4, 0, 0, "2025/01/15 15:00:00", 0, 1, 248);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "コッコロ（ニューイヤー）", 111901, "2025/01/20 11:59:59", 1, 23, 1.87, 3, 111901, "【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", 0, 1, 111901, "こっころ", 111901, 0, 0, 7, 0, 0, "2025/01/15 15:00:00", 0, 1, 159);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "キャル（ニューイヤー）", 112001, "2025/01/20 11:59:59", 2, 21, 2.07, 3, 112001, "【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", 0, 3, 112001, "きゃる", 112001, 0, 0, 7, 0, 0, "2025/01/15 15:00:00", 0, 1, 690);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズメ（ニューイヤー）", 112101, "2030/12/31 15:00:00", 2, 21, 2.27, 1, 112101, "【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", 0, 1, 112101, "すずめ", 112101, 0, 0, 7, 0, 0, "2021/11/16 15:00:00", 0, 1, 722);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カスミ（マジカル）", 112201, "2030/12/31 15:00:00", 2, 7, 2.27, 3, 112201, "【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", 0, 9, 112201, "かすみ", 112201, 0, 0, 7, 0, 0, "2020/01/31 12:00:00", 0, 0, 730);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シオリ（マジカル）", 112301, "2030/12/31 15:00:00", 1, 8, 1.97, 1, 112301, "【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", 0, 5, 112301, "しおり", 112301, 0, 0, 8, 0, 0, "2021/12/16 15:00:00", 0, 1, 712);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ウヅキ（デレマス）", 112401, "2021/03/24 11:59:59", 1, 4, 2.24, 3, 112401, "【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", 0, 18, 112401, "うづき", 112401, 0, 0, 4, 0, 0, "2021/03/08 12:00:00", 0, 1, 370);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リン（デレマス）", 112501, "2021/03/24 11:59:59", 1, 4, 2.215, 3, 112501, "【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", 0, 18, 112501, "りんでれます", 112501, 0, 0, 4, 0, 0, "2021/03/08 12:00:00", 0, 1, 153);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミオ（デレマス）", 112601, "2030/12/31 15:00:00", 2, 7, 2.27, 1, 112601, "【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", 0, 18, 112601, "みお", 112601, 0, 1, 7, 0, 0, "2015/04/01 15:00:00", 0, 1, 695);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リン（レンジャー）", 112701, "2030/12/31 15:00:00", 1, 6, 2.19, 3, 112701, "【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", 0, 3, 112701, "りん", 112701, 0, 0, 6, 0, 0, "2020/04/30 12:00:00", 0, 0, 422);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マヒル（レンジャー）", 112801, "2030/12/31 15:00:00", 1, 6, 2.19, 3, 112801, "【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。", 0, 5, 112801, "まひる", 112801, 0, 0, 6, 0, 0, "2020/05/15 15:00:00", 0, 0, 390);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リノ（ワンダー）", 112901, "2030/12/31 15:00:00", 1, 8, 1.97, 3, 112901, "【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", 0, 6, 112901, "りの", 112901, 0, 0, 8, 0, 0, "2020/06/03 19:00:00", 0, 0, 730);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アユミ（ワンダー）", 113001, "2030/12/31 15:00:00", 1, 6, 2.34, 1, 113001, "【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", 0, 12, 113001, "あゆみ", 113001, 0, 0, 6, 0, 0, "2020/05/31 12:00:00", 0, 1, 508);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ルカ（サマー）", 113101, "2024/07/31 11:59:59", 1, 27, 1.3, 3, 113101, "【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。", 0, 6, 113101, "るか", 113101, 0, 0, 27, 0, 0, "2024/07/23 12:00:00", 0, 1, 192);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アンナ（サマー）", 113201, "2030/12/31 15:00:00", 2, 28, 1.625, 1, 113201, "【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。", 0, 12, 113201, "あんな", 113201, 0, 0, 5, 0, 0, "2022/04/18 15:00:00", 0, 1, 256);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ナナカ（サマー）", 113301, "2030/12/31 15:00:00", 2, 7, 2.07, 3, 113301, "【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。", 0, 12, 113301, "ななか", 113301, 0, 0, 7, 0, 0, "2020/07/15 15:00:00", 0, 0, 468);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ハツネ（サマー）", 113401, "2024/07/31 11:59:59", 2, 29, 1.92, 3, 113401, "【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。", 0, 12, 113401, "はつね", 113401, 0, 0, 7, 0, 0, "2024/07/23 12:00:00", 0, 1, 567);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミサト（サマー）", 113501, "2030/12/31 15:00:00", 2, 7, 2.07, 1, 113501, "【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。", 0, 12, 113501, "みさと", 113501, 0, 0, 7, 0, 0, "2022/05/18 15:00:00", 0, 1, 697);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ジュン（サマー）", 113601, "2030/12/31 15:00:00", 1, 5, 2.0, 3, 113601, "【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。", 0, 12, 113601, "じゅん", 113601, 0, 0, 5, 0, 0, "2020/08/15 15:00:00", 0, 0, 182);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アカリ（エンジェル）", 113701, "2030/12/31 15:00:00", 2, 7, 1.92, 3, 113701, "【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。", 0, 12, 113701, "あかり", 113701, 0, 0, 7, 0, 0, "2020/09/03 19:00:00", 0, 0, 530);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ヨリ（エンジェル）", 113801, "2030/12/31 15:00:00", 2, 6, 2.34, 3, 113801, "【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。", 0, 12, 113801, "より", 113801, 0, 0, 6, 0, 0, "2020/09/19 15:00:00", 0, 0, 531);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ツムギ（ハロウィン）", 113901, "2024/10/28 11:59:59", 1, 2, 2.375, 3, 113901, "【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。", 0, 12, 113901, "つむぎ", 113901, 0, 0, 2, 0, 0, "2024/10/24 12:00:00", 0, 1, 152);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "レイ（ハロウィン）", 114001, "2030/12/31 15:00:00", 1, 4, 1.965, 3, 114001, "【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", 0, 12, 114001, "れい", 114001, 0, 0, 4, 0, 0, "2020/10/15 15:00:00", 0, 0, 375);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マツリ（ハロウィン）", 114101, "2030/12/31 15:00:00", 1, 1, 2.295, 1, 114101, "【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", 0, 12, 114101, "まつり", 114101, 0, 0, 1, 0, 0, "2022/07/19 8:00:00", 0, 1, 186);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "モニカ（マジカル）", 114201, "2030/12/31 15:00:00", 1, 4, 2.24, 3, 114201, "【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", 0, 12, 114201, "もにか", 114201, 0, 0, 4, 0, 0, "2020/10/31 12:00:00", 0, 0, 528);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "トモ（マジカル）", 114301, "2030/12/31 15:00:00", 1, 4, 2.0, 3, 114301, "【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", 0, 2, 114301, "とも", 114301, 0, 0, 4, 0, 0, "2020/11/21 15:00:00", 0, 0, 402);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アキノ（クリスマス）", 114401, "2024/12/31 11:59:59", 1, 5, 2.0, 3, 114401, "【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", 0, 2, 114401, "あきの", 114401, 0, 0, 5, 0, 0, "2024/12/22 12:00:00", 0, 1, 189);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "サレン（クリスマス）", 114501, "2030/12/31 15:00:00", 1, 4, 2.09, 3, 114501, "【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", 0, 3, 114501, "されん", 114501, 0, 0, 4, 0, 0, "2020/12/21 15:00:00", 0, 0, 150);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユカリ（クリスマス）", 114601, "2030/12/31 15:00:00", 1, 5, 2.09, 1, 114601, "【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", 0, 2, 114601, "ゆかり", 114601, 0, 0, 5, 0, 0, "2022/09/17 15:00:00", 0, 1, 408);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ムイミ（ニューイヤー）", 114701, "2030/12/31 15:00:00", 1, 31, 2.0, 1, 114701, "【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", 0, 2, 114701, "むいみ", 114701, 0, 0, 2, 0, 0, "2022/10/16 15:00:00", 0, 1, 138);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ネネカ（ニューイヤー）", 115001, "2025/01/20 11:59:59", 2, 21, 2.07, 3, 115001, "【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", 0, 2, 115001, "ねねか", 115001, 0, 0, 7, 0, 0, "2025/01/15 15:00:00", 0, 1, 562);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "コッコロ（儀装束）", 115501, "2025/02/24 11:59:59", 1, 2, 2.0, 3, 115501, "【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", 0, 1, 115501, "こっころ", 115501, 0, 0, 2, 0, 0, "2025/02/20 12:00:00", 0, 1, 533);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユイ（儀装束）", 115601, "2030/12/31 15:00:00", 2, 7, 1.97, 1, 115601, "【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", 0, 7, 115601, "ゆい", 115601, 0, 0, 7, 0, 0, "2022/11/17 15:00:00", 0, 1, 578);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カスミ（サマー）", 115701, "2030/12/31 15:00:00", 2, 7, 2.27, 3, 115701, "【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", 0, 9, 115701, "かすみ", 115701, 0, 0, 7, 0, 0, "2021/02/23 15:00:00", 0, 0, 738);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リマ（シンデレラ）", 115801, "2030/12/31 15:00:00", 1, 4, 2.27, 1, 115801, "【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", 0, 5, 115801, "りま", 115801, 0, 0, 4, 0, 116101, "2022/12/19 15:00:00", 0, 1, 173);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マコト（シンデレラ）", 115901, "2030/12/31 15:00:00", 1, 5, 2.27, 3, 115901, "【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", 0, 4, 115901, "まこと", 115901, 0, 0, 5, 0, 0, "2021/03/03 19:00:00", 0, 0, 166);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マホ（シンデレラ）", 116001, "2030/12/31 15:00:00", 2, 7, 2.27, 3, 116001, "【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", 0, 9, 116001, "まほ", 116001, 0, 0, 7, 0, 0, "2021/03/22 15:00:00", 0, 0, 645);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クロエ（聖学祭）", 116201, "2030/12/31 15:00:00", 1, 2, 2.125, 3, 116201, "【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", 0, 2, 116201, "くろえ", 116201, 0, 0, 2, 0, 0, "2021/04/15 15:00:00", 0, 0, 184);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "チエル（聖学祭）", 116301, "2030/12/31 15:00:00", 1, 32, 2.295, 3, 116301, "【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。", 0, 2, 116301, "ちえる", 116301, 0, 0, 1, 0, 0, "2021/03/31 12:00:00", 0, 0, 223);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユニ（聖学祭）", 116401, "2030/12/31 15:00:00", 2, 39, 2.27, 3, 116401, "【魔法】後衛から、仲間を啓蒙するユニちゃんズの才媛。\n自分以外の味方全員の物理・魔法両方の攻撃力アップと\nクリティカル時のダメージアップで皆を勝利へと導く。", 0, 2, 116401, "ゆに", 116401, 0, 0, 7, 0, 0, "2022/02/08 12:00:00", 0, 0, 808);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イノリ（タイムトラベル）", 116501, "2030/12/31 15:00:00", 1, 3, 2.295, 3, 116501, "【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。", 0, 17, 116501, "いのり", 116501, 0, 0, 3, 0, 0, "2021/04/30 12:00:00", 0, 0, 252);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カヤ（タイムトラベル）", 116601, "2030/12/31 15:00:00", 1, 1, 2.295, 3, 116601, "【物理】前衛で味方を勝利にナビする喧嘩屋ドラゴン族。\nユニオンバーストで自身の攻撃速度を極大アップさせ、\n物理攻撃力アップスキルのシナジーで拳の雨を降らせる。", 0, 17, 116601, "かや", 116601, 0, 0, 1, 0, 0, "2021/05/21 15:00:00", 0, 0, 169);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "アオイ（作業服）", 116701, "2030/12/31 15:00:00", 1, 33, 1.82, 3, 116701, "【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。", 0, 9, 116701, "あおい", 116701, 0, 0, 33, 0, 0, "2021/05/31 12:00:00", 0, 0, 527);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "タマキ（作業服）", 116801, "2030/12/31 15:00:00", 1, 2, 2.295, 1, 116801, "【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。", 0, 8, 116801, "たまき", 116801, 0, 0, 2, 0, 0, "2023/03/16 15:00:00", 0, 1, 216);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミフユ（作業服）", 116901, "2030/12/31 15:00:00", 1, 6, 2.065, 3, 116901, "【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。", 0, 8, 116901, "みふゆ", 116901, 0, 0, 6, 0, 0, "2021/06/16 15:00:00", 0, 0, 275);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "エリコ（サマー）", 117001, "2024/08/31 11:59:59", 1, 3, 1.55, 3, 117001, "【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。", 0, 11, 117001, "えりこ", 117001, 0, 0, 3, 0, 0, "2024/08/26 19:00:00", 0, 1, 407);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シズル（サマー）", 117101, "2030/12/31 15:00:00", 1, 5, 2.0, 3, 117101, "【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。", 0, 6, 117101, "しずる", 117101, 0, 0, 5, 0, 0, "2021/07/15 12:00:00", 0, 0, 163);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ノゾミ（サマー）", 117201, "2024/08/31 11:59:59", 1, 4, 2.09, 3, 117201, "【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。", 0, 10, 117201, "のぞみ", 117201, 0, 0, 4, 0, 0, "2024/08/26 19:00:00", 0, 1, 417);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "チカ（サマー）", 117301, "2030/12/31 15:00:00", 2, 7, 2.07, 3, 117301, "【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。", 0, 10, 117301, "ちか", 117301, 0, 0, 7, 0, 0, "2021/08/15 15:00:00", 0, 0, 520);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ツムギ（サマー）", 117401, "2030/12/31 15:00:00", 1, 1, 2.42, 1, 117401, "【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。", 0, 10, 117401, "つむぎ", 117401, 0, 0, 1, 0, 0, "2023/05/16 15:00:00", 0, 1, 355);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミツキ（オーエド）", 117501, "2030/12/31 15:00:00", 1, 5, 2.4, 3, 117501, "【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。", 0, 11, 117501, "みつき", 117501, 0, 0, 5, 0, 0, "2021/09/03 19:00:00", 0, 0, 552);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ユキ（オーエド）", 117601, "2030/12/31 15:00:00", 2, 7, 2.0, 3, 117601, "【魔法】後衛で、迷える皆を救う白衣を纏いし美の象徴。\n一番低い味方１キャラのＴＰを回復し、ＨＰ回復スキルで\n守り、魔法攻撃力アップのスキルで一気に攻め落とす。", 0, 12, 117601, "ゆき", 117601, 0, 0, 7, 0, 0, "2021/09/13 12:00:00", 0, 0, 798);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カオリ（ハロウィン）", 117701, "2024/10/28 11:59:59", 1, 1, 2.17, 3, 117701, "【物理】前衛の敵を追い詰める程、力を増す幽玄南国娘。\n敵の体力が少ない程、効果が高まる攻撃力アップスキルと\nダメージ量アップの攻撃スキルで、敵を逃さず仕留める。", 0, 4, 117701, "かおり", 117701, 0, 0, 1, 0, 0, "2024/10/24 12:00:00", 0, 1, 156);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ニノン（ハロウィン）", 117801, "2030/12/31 15:00:00", 1, 36, 2.25, 1, 117801, "【物理】中衛で物理攻撃タイプの味方を強化するシノビ。\n味方の物理攻撃力アップや行動速度アップのスキル効果で\n味方全体の攻撃力を底上げし、勝利の笛を吹きならす。", 0, 12, 117801, "にのん", 117801, 0, 0, 36, 0, 0, "2023/07/18 15:00:00", 0, 1, 518);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "スズナ（ハロウィン）", 117901, "2030/12/31 15:00:00", 1, 8, 1.97, 3, 117901, "【物理】後衛でアタッカーを狙う小悪魔カリスマモデル。\n誘惑状態だと威力アップの攻撃スキルや、ＴＰを奪い取る\n妨害スキルを放ち、物理攻撃力が最も高い敵を狙い撃つ。", 0, 15, 117901, "すずな", 117901, 0, 0, 8, 0, 0, "2021/10/15 15:00:00", 0, 0, 761);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クレジッタ", 118001, "2024/09/30 11:59:59", 1, 35, 1.97, 3, 118001, "【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。", 0, 0, 118001, "くれじった", 118001, 0, 0, 35, 0, 0, "2024/09/25 12:00:00", 0, 1, 751);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ランファ", 118101, "2025/03/03 18:59:59", 2, 21, 2.07, 3, 118101, "【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。", 0, 19, 118101, "らんふぁ", 118101, 0, 0, 7, 0, 0, "2025/02/28 12:00:00", 0, 1, 782);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミソラ", 118201, "2025/03/03 18:59:59", 2, 0, 1.7, 3, 118201, "【魔法】後衛で笑顔とともに破壊を振りまく溌溂少女★\n最大３体に着弾するスキルとＵＢは【PSI★チャージ】\n状態で魔防ダウン効果を追加し、邪魔者たちを殲滅する。", 0, 19, 118201, "みそら", 118201, 0, 0, 0, 0, 0, "2025/02/28 12:00:00", 0, 1, 730);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "ハツネ（ハツネ&シオリ）", 118301, "2030/12/31 15:00:00", 0, 0, 0.0, 3, 118301, "", 0, 0, 0, "はつね", 0, 180701, 1, 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 732);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, "シオリ（ハツネ&シオリ）", 118401, "2030/12/31 15:00:00", 0, 0, 0.0, 3, 118401, "", 0, 0, 0, "しおり", 0, 180701, 1, 0, 0, 0, "2015/04/01 15:00:00", 0, 1, 732);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "カリン", 118501, "2030/12/31 15:00:00", 2, 37, 2.0, 1, 118501, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 0, 0, 118501, "かりん", 118501, 0, 0, 37, 0, 0, "2021/10/19 12:00:00", 0, 1, 787);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ネビア", 118601, "2030/12/31 15:00:00", 2, 0, 2.0, 3, 118601, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 0, 118601, "ねびあ", 118601, 0, 0, 0, 0, 0, "2024/08/10 21:00:00", 0, 1, 826);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "イオ（ノワール）", 119001, "2030/12/31 15:00:00", 2, 7, 2.27, 3, 119001, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 15, 119001, "いお", 119001, 0, 0, 7, 0, 0, "2021/11/03 19:00:00", 0, 0, 714);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "クウカ（ノワール）", 119101, "2030/12/31 15:00:00", 2, 26, 2.545, 3, 119101, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 12, 119101, "くうか", 119101, 0, 0, 7, 0, 0, "2021/11/16 12:00:00", 0, 0, 143);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "マヒル（クリスマス）", 119201, "2030/12/31 15:00:00", 1, 6, 2.19, 1, 119201, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 0, 5, 119201, "まひる", 119201, 0, 0, 6, 0, 0, "2023/09/19 15:00:00", 0, 1, 397);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "リノ（クリスマス）", 119301, "2030/12/31 15:00:00", 1, 8, 1.97, 3, 119301, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 0, 6, 119301, "りの", 119301, 0, 0, 8, 0, 0, "2021/12/22 12:00:00", 0, 0, 762);
