INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "ミヤコ（クリスマス）", 119901, "2024/12/31 11:59:59", 1, 1, 2.17, 3, 119901, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, 14, 119901, "みやこ", 119901, 0, 0, 1, 0, 0, "2024/12/22 12:00:00", 0, 1, 302);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (450, "シズル（ノワール）", 120001, "2025/03/15 14:59:59", 1, 5, 2.375, 3, 120001, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, 6, 120001, "しずる", 120001, 0, 0, 5, 0, 0, "2025/03/10 12:00:00", 0, 1, 190);
